import React from 'react'
import ReactDOM from 'react-dom';
import { numberTypeAnnotation } from 'babel-types';
import './CreatorConnect.css';
import { Route, BrowserRouter as Router, Link } from 'react-router-dom';
import {render} from 'react-dom';
import Multiselect from 'multiselect-dropdown-react';

//*This is the Login Component that will prompt users to either sign up or login to CreatorConnect*/

//NOTE- YOUR HTML CODE NEEDS TO BE AT WRAPPED AROUND A DIV OBJECT.
const STYLE = {
  SPAN:
  {
    fontSize: "1.5em"
  }
}

const { Component, Children, PropTypes } = React
const { Select, Option, utils } = Selectly
const { getToggledOptions } = utils

class CheckboxOption extends Component {
  render() {
    const { value, isChecked, children } = this.props
    return (
      <Option className="react-select-option" value={value}>
        <input
          type="checkbox"
          className="react-select-option__checkbox"
          defaultValue={null}
          checked={isChecked}
        />
        <div className="react-select-option__label">
          {children}
        </div>
      </Option>
    )
  }
}

class CheckboxMultiSelect extends Component {
  constructor(props) {
    super(props)
    this.state = {
      defaultValue: 'Select a color',
      currentValues: []
    }
    this._handleChange = this._handleChange.bind(this)
  }

  _handleChange(value) {
    this.setState({
      currentValues: getToggledOptions(this.state.currentValues, value)
    })
  }

  render() {
    const { defaultValue, currentValues } = this.state

    return (
      <Select
        classPrefix="react-select"
        multiple
        onChange={this._handleChange}
      >
        <button className="react-select-trigger">
          { currentValues.length > 0
            ? currentValues.join(', ')
            : defaultValue
          }
        </button>
        <div className="react-select-menu">
          <ul className="react-select-options">
            <CheckboxOption value="red" isChecked={currentValues.indexOf('red') > -1}>
              Red
            </CheckboxOption>
            <CheckboxOption value="green" isChecked={currentValues.indexOf('green') > -1}>
              Green
            </CheckboxOption>
            <CheckboxOption value="blue" isChecked={currentValues.indexOf('blue') > -1}>
              Blue
            </CheckboxOption>
          </ul>
        </div>
      </Select>
    )
  }
}


class Launch extends React.Component {
  render() { 
    return (
      <div>{/* DO NOT REMOVE THIS DIV COMPONENT*/}
      <script src="https://cdn.jsdelivr.net/npm/bootstrap-select@1.13.9/dist/js/bootstrap-select.min.js"></script>
      <div className ="bothDivs">
        <div className = "leftDiv">
          <img src="https://innovation.fsu.edu/images/logo300.png" className = "hubLogo"></img>
        </div>
        <div className = "rightDiv">
          <div className = "signUpOrIn">
            <div className = "CreatorConnectLogo">
              <h4><span style={STYLE.SPAN}>C</span>reator<span style={STYLE.SPAN}>C</span>onnect</h4>
              <div className = "information">
              <form action="" method="POST">
                  <input className="inputBox" type="text" name="firstName" placeholder="First Name"></input>


                  <input className="inputBox" type="text" name="lastName" placeholder="Last Name"></input>

                  <input className="inputBox" type="text" name="fsuEmail" placeholder="FSU e-mail"></input>

                  <input className="inputBox" type="password" name="password" placeholder="Password"></input>

                  <input className="inputBox" type="password" name="verify" placeholder="Verify Password"></input>

                  <input className="inputBox" type="text" name="gradyear" placeholder="Grad Year"></input>

                  <Multiselect options={data} onSelectOptions={this.result} />



            <button type="submit">Submit!</button>
        </form>
              </div>
            </div>
          </div>
        </div>
      </div>
         {/*<h2><span style={STYLE.SPAN}>C</span>reator<span style={STYLE.SPAN}>C</span>onnect</h2>

        <div className = "buttonWrapper">
          <Link to="/signUp">
            <button type="button" className="customButton">Sign Up</button>
          </Link>
        </div>
        <div className = "buttonWrapper">
          <Link to="/login">
            <button type="button" className="customButton">Login</button>
          </Link>
    </div>*/}
      {/* DO NOT REMOVE THIS DIV COMPONENT*/}</div>
      )
  }
}
export default Launch
